module.exports = "<h2 id=\"component-description\">Component Description</h2>\n<p>A Nessie Button component is a button with different appearences (<em>roles</em>), a loading state and an optional icon.</p>\n<h2 id=\"example-usage\">Example Usage</h2>\n<p>A primary button in read-only state:</p>\n<pre><code>&lt;Button isDisabled={ true }&gt;Can’t click me!&lt;/Button&gt;\n</code></pre><p>A primary button in loading state:</p>\n<pre><code>&lt;Button isLoading={ true }&gt;Can’t click me!&lt;/Button&gt;\n</code></pre><p>A primary button width an icon on the right:</p>\n<pre><code>&lt;Button iconType=&quot;right&quot; iconPosition=&quot;right&quot;&gt;Next Page&lt;/Button&gt;\n</code></pre><hr>\n<p>A subtle button:</p>\n<pre><code>&lt;Button label=&quot;Ended!&quot; role=&quot;subtle&quot; iconType=&quot;ended&quot;&gt;Ended!&lt;/Button&gt;\n</code></pre><hr>\n<p>A secondary button:</p>\n<pre><code>&lt;Button role=&quot;secondary&quot;&gt;Click me!&lt;/Button&gt;\n</code></pre>";

