module.exports = "<h2 id=\"component-description\">Component Description</h2>\n<p>A Nessie CheckboxGroup is just a wrapper for convenience: it builds a checkbox group from an array of strings _or_ an array of objects with the following shape:</p>\n<pre><code>{\n    label      : &lt;string&gt;,\n    value      : &lt;string&gt;,\n    isReadOnly : &lt;boolean&gt;,\n    isDisabled : &lt;boolean&gt;,\n    hasError   : &lt;boolean&gt;\n}\n</code></pre><p><strong>This is not the preferred method of building a checkbox group.</strong> Instead consider building the Checkboxes yourself wrapping them with the generic CheckableGroup component.</p>\n<h2 id=\"example-usage\">Example Usage</h2>\n<p>Values set using array of strings:</p>\n<pre><code>&lt;CheckboxGroup label          = &quot;Which fruits do you like?&quot;\n               values         = { [ &#39;apples&#39;, &#39;oranges&#39;, &#39;kaki&#39; ] }\n               selectedValues = { [ &#39;apples&#39;, &#39;kaki&#39; ] }/&gt;\n</code></pre><p>or using an array of objects:</p>\n<pre><code>&lt;CheckboxGroup label   = &quot;Which fruits do you like?&quot;\n               values  = { [\n                              { label: &#39;apples&#39;,  value: &#39;value1&#39;, isReadOnly : true },\n                              { label: &#39;oranges&#39;, value: &#39;value2&#39;, isDisabled : true },\n                              { label: &#39;kaki&#39;,    value: &#39;value3&#39;, hasError : true },\n                         ] }\n               selectedValues = { [ &#39;value1&#39;, &#39;value3&#39; ] }/&gt;\n</code></pre><p>Individual checkboxes can be independently configured to be read-only, disabled, or\nin error state, which are <code>OR</code>&#39;d with the corresponding props in the checkbox group.</p>\n";

