module.exports = "<h2 id=\"component-description\">Component Description</h2>\n<p>Nessie Flounder dropdown component:</p>\n<ul>\n<li>Does everything Flounder can do and more.</li>\n<li>Native <code>flounder</code> object is accessible for API calls as <code>refs.flounder</code> (use\nwith caution!)</li>\n<li>Can be styled as a header (H1-4) by specifying the optional the <code>headerLevel</code>\nprop.</li>\n</ul>\n<p>The following native Flounder options are supported as props:</p>\n<ul>\n<li><code>data</code> (with additional property <code>icon</code>)</li>\n<li><code>defaultValue</code> (has the usual React meaning here, unlike in native Flounder, also supports array)</li>\n<li><code>multiple</code></li>\n<li><code>multipleTags</code></li>\n<li><code>multipleMessage</code></li>\n<li><code>noMoreOptionsMessage</code></li>\n<li><code>noMoreResultsMessage</code></li>\n<li><code>onChange</code></li>\n<li><code>onClose</code></li>\n<li><code>onFirstTouch</code></li>\n<li><code>onInputChange</code></li>\n<li><code>onOpen</code></li>\n<li><code>openOnHover</code></li>\n<li><code>placeholder</code> (placeholder is <em>always</em> added, unlike native Flounder)</li>\n<li><code>search</code></li>\n</ul>\n<p>The following native options have no sense in FlounderDropdown and are <strong>not</strong>\nsupported:</p>\n<ul>\n<li><code>allowHTML</code> (current implementation considered dangerous)</li>\n<li><code>classes</code> (use <code>cssMap</code> instead)</li>\n<li><code>defaultEmpty</code> (instead omit <code>value</code> and/or <code>defaultValue</code> prop)</li>\n<li><code>defaultIndex</code> (use <code>value</code> instead)</li>\n<li><code>disableArrow</code> (set <code>icon</code> to <code>&#39;none&#39;</code> instead)</li>\n<li><code>keepChangesOnDestroy</code> (not applicable)</li>\n<li><code>onComponentDidMount</code> (not applicable)</li>\n<li><code>onComponentWillUnmount</code> (not applicable)</li>\n<li><code>onInit</code> (not applicable)</li>\n<li><code>selectDataOverride</code> (not applicable)</li>\n</ul>\n<h2 id=\"example-usage\">Example Usage</h2>\n<p>Using a data object:</p>\n<pre><code>&lt;FlounderDropdown data = { [\n                            {\n                                &quot;text&quot;  : &quot;flounderOptionText1&quot;,\n                                &quot;value&quot; : &quot;flounderOptionValue1&quot;,\n                            },\n                            {\n                                &quot;text&quot;  : &quot;flounderOptionText2&quot;,\n                                &quot;value&quot; : &quot;flounderOptionValue2&quot;\n                            }\n                        ] } /&gt;\n</code></pre><p>With a label, using simple strings as data:</p>\n<pre><code>&lt;FlounderDropdown label : &quot;Pick an animal&quot;,\n                  data  : { [ &#39;dog&#39;, &#39;cat&#39;, &#39;panda&#39; ] } /&gt;\n</code></pre><p>A header (H1) dropdown:</p>\n<pre><code>&lt;FlounderDropdown headerLevel = { 1 }\n                  data  : { [ &#39;apples&#39;, &#39;oranges&#39;, &#39;pears&#39; ] } /&gt;\n</code></pre><p>An icon can be shown for a given dropdown option by setting the <code>icon</code>\nproperty:</p>\n<pre><code>&lt;FlounderDropdown data = { [\n                            {\n                                &quot;text&quot;       : &quot;flounderOptionText1&quot;,\n                                &quot;value&quot;      : &quot;flounderOptionValue1&quot;,\n                                &quot;icon&quot;       : &quot;blueDot&quot;\n                            },\n                            ...\n                        ] } /&gt;\n</code></pre><p>The following icons are available:</p>\n<ul>\n<li><code>alert</code></li>\n<li><code>approved</code></li>\n<li><code>blueDot</code></li>\n<li><code>declined</code></li>\n<li><code>ended</code></li>\n<li><code>error</code></li>\n<li><code>include</code></li>\n<li><code>exclude</code></li>\n<li><code>includeExclude</code></li>\n<li><code>pending</code></li>\n</ul>\n<h2 id=\"test-data-for-lochness\">Test <code>data</code> for Lochness</h2>\n<p>Paste this into the <code>data</code> field to add extra test data:</p>\n<pre><code>[\n   &quot;Option&quot;,\n    {\n        &quot;text&quot;        : &quot;Option with description&quot;,\n        &quot;value&quot;       : &quot;value2&quot;,\n        &quot;description&quot; : &quot;Option description&quot;\n    },\n    {\n        &quot;text&quot;  : &quot;Option with icon (blueDot)&quot;,\n        &quot;value&quot; : &quot;value3&quot;,\n        &quot;icon&quot;  : &quot;blueDot&quot;\n    },\n    {\n        &quot;text&quot;        : &quot;Option with icon (approved) and description&quot;,\n        &quot;value&quot;       : &quot;value4&quot;,\n        &quot;description&quot; : &quot;Option description&quot;,\n        &quot;icon&quot;        : &quot;approved&quot;\n    },\n    {\n        &quot;text&quot;     : &quot;Disabled option&quot;,\n        &quot;value&quot;    : &quot;value5&quot;,\n        &quot;disabled&quot; : true\n    },\n    {\n        &quot;text&quot;        : &quot;Disabled option with description&quot;,\n        &quot;description&quot; : &quot;Option description&quot;,\n        &quot;value&quot;       : &quot;value6&quot;,\n        &quot;disabled&quot;    : true\n    },\n    {\n\n        &quot;text&quot;     : &quot;Disabled option with icon&quot;,\n        &quot;value&quot;    : &quot;value7&quot;,\n        &quot;icon&quot;     :&quot;error&quot;,\n        &quot;disabled&quot; : true\n    },\n    {\n        &quot;text&quot;        : &quot;Disabled option with icon and description&quot;,\n        &quot;description&quot; : &quot;Option description&quot;,\n        &quot;value&quot;       : &quot;value8&quot;,\n        &quot;icon&quot;        :&quot;ended&quot;,\n        &quot;disabled&quot;    : true\n    },\n    {\n        &quot;text&quot;  : &quot;Option with really, really, really, really, really, really, really, really, really, long text&quot;,\n        &quot;value&quot; : &quot;value9&quot;\n    },\n    {\n        &quot;text&quot;        : &quot;Option with really, really, really, really, really, really, really, really, really, long text and a long description too&quot;,\n        &quot;description&quot; : &quot;Option description is really, really, really, really, really, really, long too&quot;,\n        &quot;value&quot;       : &quot;value10&quot;\n    },\n    {\n        &quot;text&quot;        : &quot;Option with really, really, really, really, really, really, really, really, really, long text and a long description and an icon&quot;,\n        &quot;description&quot; : &quot;Option description is also really, really, really, really, really, really, long&quot;,\n        &quot;value&quot;       : &quot;value11&quot;,\n        &quot;icon&quot;        : &quot;pending&quot;\n    },\n    {\n        &quot;text&quot;        : &quot;Disabled option with really, really, really, really, really, really, really, really, really, long text and a long description and an icon&quot;,\n        &quot;description&quot; : &quot;Option description is also really, really, really, really, really, really, long&quot;,\n        &quot;value&quot;       : &quot;value12&quot;,\n        &quot;icon&quot;        : &quot;alert&quot;,\n        &quot;disabled&quot;    : true\n    },\n    {\n        &quot;header&quot; : &quot;Subsection 1&quot;,\n        &quot;data&quot;   : [\n            &quot;Subsection option 1&quot;,\n            &quot;Subsection option 2&quot;,\n            {\n                &quot;text&quot;        : &quot;Subsection option with really, really, really, really, really, really, really, really, really, long text and a long description and an icon&quot;,\n                &quot;description&quot; : &quot;Option description is also really, really, really, really, really, really, long&quot;,\n                &quot;value&quot;       : &quot;value12&quot;,\n                &quot;icon&quot;        : &quot;alert&quot;\n            } ]\n    },\n    {\n        &quot;header&quot; : &quot;Subsection 2&quot;,\n        &quot;data&quot;   : [\n            &quot;Subsection option 1&quot;,\n            &quot;Subsection option 2&quot;,\n            {\n                &quot;text&quot;        : &quot;Subsection option with really, really, really, really, really, really, really, really, really, long text and a long description and an icon&quot;,\n                &quot;description&quot; : &quot;Option description is also really, really, really, really, really, really, long&quot;,\n                &quot;value&quot;       : &quot;value13&quot;,\n                &quot;icon&quot;        : &quot;alert&quot;\n            } ]\n    }\n]\n</code></pre>";

