module.exports = "<h2 id=\"component-description\">Component Description</h2>\n<p>The Grid is the basis of the Nessie layout system.</p>\n<p>The Nessie layout system doesn’t restrict you to a single grid with _x_ columns.\nInstead you have the power to define any grid you like, up to 24 columns,\nwith three possible gutter sizes (or no gutters at all).</p>\n<p>What’s more, you’re free to define <em>multiple</em> grids and sub-grids which you can\nmix and match as you see fit. (With great power comes great responsibility.\nWe urge you to exercise restraint.)</p>\n<h3 id=\"setting-up-a-grid\">Setting up a Grid</h3>\n<p>Let’s set up a simple grid with three Columns:</p>\n<pre><code>&lt;Grid&gt;\n    &lt;Column size=&quot;1/3&quot;&gt;...&lt;/Column&gt;\n    &lt;Column size=&quot;1/3&quot;&gt;...&lt;/Column&gt;\n    &lt;Column size=&quot;1/3&quot;&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>Here we use the <code>size</code> prop of each Column to set its respective width. The\nresult is:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +---[ Column ]-----+  +---[ Column ]-----+  +---[ Column ]-----+  |\n|  |                  |  |                  |  |                  |  |\n|  +------------------+  +------------------+  +------------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><h3 id=\"column-sizes\">Column sizes</h3>\n<p>Configure the width of Columns using their <code>size</code> prop.  The <code>size</code> prop accepts\nany fraction down to 1/24 (expressed as a string: <code>&quot;1/24&quot;</code>) or the value\n<code>&quot;content&quot;</code>.</p>\n<p><code>&quot;content&quot;</code> will use the Column’s content width as its size.</p>\n<h4 id=\"fractional-sizes\">Fractional sizes</h4>\n<p>Fractional sizes allow you define an _n_-column grid, where _n_ is the total\nnumber of columns. If we want to have a Column component that spans _s_ grid\ncolumns then its <code>size</code> is the fraction <em>s/n</em>.</p>\n<p>For example, a Column that spans 4 grid columns in a grid layout of 24 columns\nis expressed as:</p>\n<pre><code>&lt;Column size=&quot;4/24&quot;/&gt;\n</code></pre><p>It’s recommended to always use the same denominator for a given Grid and,\nideally, throughout your application to ensure a consistent overall layout.</p>\n<h4 id=\"grids-without-sizes\">Grids Without Sizes</h4>\n<p>If you don’t set column sizes the column widths will be distributed evenly. You\ncan totally mix Columns with and without sizes in the same Grid:</p>\n<pre><code>&lt;Grid&gt;\n    &lt;Column size=&quot;1/3&quot;&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>The result here will be identical the previous example – that is, three columns\nof 1/3:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +---[ Column ]-----+  +---[ Column ]-----+  +---[ Column ]-----+  |\n|  |                  |  |                  |  |                  |  |\n|  +------------------+  +------------------+  +------------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><h3 id=\"grid-gutters\">Grid gutters</h3>\n<p>The horizontal space between any two Columns in a Grid is called the gutter. You\ncan configure gutter size used in a given Grid using the Grid’s <code>gutters</code> prop.</p>\n<p>The prop accepts one of four values: <code>&quot;S&quot;</code>, <code>&quot;M&#39;</code> (default), <code>&quot;L&quot;</code> and <code>&quot;none&quot;</code>\n(no gutters).</p>\n<h3 id=\"grid-spacing\">Grid spacing</h3>\n<p>Configure the vertical spacing between Grids using the Grid’s <code>spacing</code> prop.\nThe prop accepts one of four values: <code>&quot;S&quot;</code>, <code>&quot;M&quot;</code> (default), <code>&quot;L&quot;</code> and <code>&quot;none&quot;</code>\n(no spacing).</p>\n<h3 id=\"grid-wrap\">Grid wrap</h3>\n<p>You can control whether the Grid content will wrap using the <code>hasWrap</code> boolean\nprop (default <code>true</code>).</p>\n<p>For convenience, a Row component is also avaiable: it’s simply a Grid whose \n<code>hasWrap</code> prop is always <code>false</code>. Use it the same as you’d use Grid:</p>\n<pre><code>&lt;Row&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Row&gt;\n</code></pre><h3 id=\"grid-alignment-or-aligning-columns-inside-grids\">Grid alignment — or, aligning Columns inside Grids</h3>\n<p>You can control horizontal and vertical alignment of Columns inside a Grid using\nthe Grid’s <code>align</code> and <code>verticalAlign</code> props, respectively.</p>\n<h4 id=\"horizontal-alignment\">Horizontal alignment</h4>\n<p>The Grid’s <code>align</code> prop accepts one of four values: <code>&quot;auto&quot;</code> (default),\n<code>&quot;left&quot;</code>, <code>&quot;right&quot;</code> and <code>&quot;center&quot;</code>.</p>\n<p>The default value (<code>&quot;auto&quot;</code>):</p>\n<pre><code>&lt;Grid align=&quot;auto&quot;&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will distribute the Column widths equally (if no specific widths have been set\non individual Columns):</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +---[ Column ]-----+  +---[ Column ]-----+  +---[ Column ]-----+  |\n|  |                  |  |                  |  |                  |  |\n|  +------------------+  +------------------+  +------------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;left&quot;</code>:</p>\n<pre><code>&lt;Grid align=&quot;right&quot;&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content width of each Column and align the Columns to the left of\nthe Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +-[ Column ]--+  +-[ Column ]-+  +-[ Column ]-+                   |\n|  |             |  |            |  |            |                   |\n|  +-------------+  +------------+  +------------+                   |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;right&quot;</code>:</p>\n<pre><code>&lt;Grid align=&quot;right&quot;&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content width of each Column and align the Columns to the right of\nthe Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|                   +-[ Column ]--+  +-[ Column ]-+  +-[ Column ]-+  |\n|                   |             |  |            |  |            |  |\n|                   +-------------+  +------------+  +------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;center&quot;</code>:</p>\n<pre><code>&lt;Grid align=&quot;center&quot;&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n    &lt;Column&gt;...&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content width of each Column and align the Columns to the center of\nthe Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|          +-[ Column ]--+  +-[ Column ]-+  +-[ Column ]-+           |\n|          |             |  |            |  |            |           |\n|          +-------------+  +------------+  +------------+           |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><h4 id=\"vertical-alignment\">Vertical alignment</h4>\n<p>The Grid’s <code>verticalAlign</code> prop accepts one of four values: <code>&quot;auto&quot;</code> (default),\n<code>&quot;top&quot;</code>, <code>&quot;middle&quot;</code> and <code>&quot;bottom&quot;</code>.</p>\n<p>The default value (<code>&quot;auto&quot;</code>):</p>\n<pre><code>&lt;Grid verticalAlign=&quot;auto&quot;&gt;\n    &lt;Column&gt;&lt;Text&gt;First column&lt;/Text&gt;&lt;/Column&gt;\n    &lt;Column&gt;\n        &lt;Text&gt;Second&lt;/Text&gt;\n        &lt;Text&gt;column&lt;/Text&gt;\n    &lt;/Column&gt;\n    &lt;Column&gt;&lt;Text&gt;Third column&lt;/Text&gt;&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will make all the Columns full height:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +---[ Column ]-----+  +---[ Column ]-----+  +---[ Column ]-----+  |\n|  | First column     |  | Second           |  | Third column     |  |\n|  |                  |  | column           |  |                  |  |\n|  +------------------+  +------------------+  +------------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;top&quot;</code>:</p>\n<pre><code>&lt;Grid verticalAlign=&quot;top&quot;&gt;\n    &lt;Column&gt;&lt;Text&gt;First column&lt;/Text&gt;&lt;/Column&gt;\n    &lt;Column&gt;\n        &lt;Text&gt;Second&lt;/Text&gt;\n        &lt;Text&gt;column&lt;/Text&gt;\n     &lt;/Column&gt;\n    &lt;Column&gt;&lt;Text&gt;Third column&lt;/Text&gt;&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content height of each Column and align the Columns to the top of\nthe Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|  +---[ Column ]-----+  +---[ Column ]-----+  +---[ Column ]-----+  |\n|  | First column     |  | Second           |  | Third column     |  |\n|  +------------------+  | column           |  +------------------+  |\n|                        +------------------+                        |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;middle&quot;</code>:</p>\n<pre><code>&lt;Grid verticalAlign=&quot;middle&quot;&gt;\n    &lt;Column&gt;&lt;Text&gt;First column&lt;/Text&gt;&lt;/Column&gt;\n    &lt;Column&gt;\n        &lt;Text&gt;The&lt;/Text&gt;\n        &lt;Text&gt;second&lt;/Text&gt;\n        &lt;Text&gt;column&lt;/Text&gt;\n    &lt;/Column&gt;\n    &lt;Column&gt;&lt;Text&gt;Third column&lt;/Text&gt;&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content height of each Column and align the Columns to the middle\nof the Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|                        +---[ Column ]-----+                        |\n|  +---[ Column ]-----+  | The              |  +---[ Column ]-----+  |\n|  | First column     |  | second           |  | Third column     |  |\n|  +------------------+  | column           |  +------------------+  |\n|                        +------------------+                        |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><p>The value <code>&quot;bottom&quot;</code>:</p>\n<pre><code>&lt;Grid verticalAlign=&quot;bottom&quot;&gt;\n    &lt;Column&gt;&lt;Text&gt;First column&lt;/Text&gt;&lt;/Column&gt;\n    &lt;Column&gt;\n        &lt;Text&gt;Second&lt;/Text&gt;\n        &lt;Text&gt;column&lt;/Text&gt;\n    &lt;/Column&gt;\n    &lt;Column&gt;&lt;Text&gt;Third column&lt;/Text&gt;&lt;/Column&gt;\n&lt;/Grid&gt;\n</code></pre><p>will use the content height of each Column and align the Columns to the bottom\nof the Grid:</p>\n<pre><code>+---[ Grid ]---------------------------------------------------------+\n|                        +---[ Column ]-----+                        |\n|  +---[ Column ]-----+  | Second           |  +---[ Column ]-----+  |\n|  | First column     |  | column           |  | Third column     |  |\n|  +------------------+  +------------------+  +------------------+  |                                                                  \n+--------------------------------------------------------------------+\n</code></pre><h3 id=\"aligning-components-inside-columns\">Aligning components <em>inside</em> Columns</h3>\n<p>You can control horizontal and vertical alignment of components inside a Column\nusing the Column’s <code>align</code> and <code>verticalAlign</code> props, respectively.</p>\n<h4 id=\"horizontal-alignment\">Horizontal alignment</h4>\n<p>The Column’s <code>align</code> prop accepts one of four values: <code>&quot;auto&quot;</code> (default),\n<code>&quot;left&quot;</code>, <code>&quot;right&quot;</code> and <code>&quot;center&quot;</code>.</p>\n<p><code>&quot;auto&quot;</code> will make all components inside the Column full width. The other\nvalues will use the content width of the components and align them to the left,\nright or center of the Column, respectively.</p>\n<h4 id=\"vertical-alignment\">Vertical alignment</h4>\n<p>The Column’s <code>verticalAlign</code> prop accepts one of four values: <code>&quot;auto&quot;</code>\n(default), <code>&quot;top&quot;</code>, <code>&quot;middle&quot;</code> and <code>&quot;bottom&quot;</code>.</p>\n<p><code>&quot;auto&quot;</code> will distribute the heights of components inside the Column equally.\nThe other values will use the content height of the components and align them\nto the top, middle or center of the Column, respectively.</p>\n";

