module.exports = "<h1 id=\"common-drivers\">Common Drivers</h1>\n<p>Component drivers can be standalone classe explicitly simulating each action. \nThat said, There are base Component Drivers that implement much of what many \nsimple components need.</p>\n<p>A simple component is a component made of a single (or a main) component that \nrequires interaction. components can inherit one of the following:</p>\n<ol>\n<li><code>SimpleComponentDriver</code> - assumes the component can be hovered, focused and the \nlike.</li>\n<li><code>ClickableComponentDriver</code> - assumes the component can be clicked (inherits \neverything from <code>SimpleComponentDriver</code> as well)</li>\n<li><code>InputComponentDriver</code> - assume the component is an input component, meaning \nthat a key can be pressed into it, and that it has a value.</li>\n</ol>\n<p>In order to inherit one of this, you need to identify the inner component that \nthe events should act on. Identifying this, you should pass the a selector to \nthe constructor of the chosen super class.</p>\n<p>Some Components are &quot;Compound Components&quot;, meaning that while they might not \ninheirt one of the super classes mentioned above, they might have a reference to\n a few child drivers, and each of them will inherit an appropriate super class. \n For exmaple, a formDriver is using two drivers. One for cancel button, and one \n for a save button. Each of them is A <code>ButtonDriver</code> that inherits \n <code>ClickableComponentDriver</code>.</p>\n";

